import React from 'react';
import { useUser } from '@clerk/clerk-react';
import './Profile.css'

function Profile () {
    const { user } = useUser();

    if (!user) return <div>Loading...</div>;

    return (
        <div className='profile-page'>
            <h2>Welcome, {user.firstName}!</h2>
            <img src={user.imageUrl} alt="Profile Pic" className='profile-pic' />

            <div className='profile-info'>
                <p><strong>First Name:</strong> {user.firstName}</p>
                <p><strong>Last Name:</strong> {user.lastName}</p>
                <p><strong>Email:</strong> {user.primaryEmailAddress?.emailAddress}</p>
                <p><strong>Phone:</strong> {user.phoneNumbers[0]?.phoneNumber || 'N/A'}</p>
                <p><strong>Card on file:</strong> Visa ending in **** 1234</p>
                <p><strong>Current Teams:</strong> Team Example</p>
            </div>
        </div>

    )
}

export default Profile;
